// SPDX-License-Identifier:MIT
pragma solidity ^0.8;
contract testContract{
    // 可接受主币
    receive() external payable{}
    uint public a;

    constructor(uint _a) payable{
        a=_a;
    }
    function getContractName()external pure returns(string memory){
        return "testContract";
    }
    function setA(uint _a)external{
        a = _a;
    }
}
contract callContract{
    // 创建了一个合约
    testContract t = new testContract{value:5*10**18}(5);
    address public contractaddr = address(t);  //可以获取创建的合约地址 可以通过地址把合约导入看下是否对的上
    string public str = t.getContractName();
    function setA(uint _a)external {
        t.setA(_a);
    }
    function getA()external view returns(uint){
        return t.a(); //通过public生成的getter方法读取状态变量
    }
    // type(合约类型)   可以获取合约的相关的参数
    string public str1 = type(testContract).name;
    bytes public by = type(testContract).creationCode;
}

